import { validTypes } from "./Constants.js";
export async function loadEmojiShape(engine, refresh = true) {
    const { EmojiDrawer } = await import("./EmojiDrawer.js");
    await engine.addShape(validTypes, new EmojiDrawer(), refresh);
}
